#!/usr/bin/env python3

input = [ "",
"",
"",
"",
""]
# input = ["ULL",
	 # "RRDDD",
	 # "LURDL",
	 # "UUUUD"]

keypad = [ [ 1, 2, 3],
	   [ 4, 5, 6],
	   [ 7, 8, 9]]
keypad2 = [
[None,  None,  "1",  None,  None],
[None,  "2",   "3",  "4",   None],
["5",   "6",   "7",  "8",   "9"],
[None,  "A",   "B",  "C",   None],
[None,  None,  "D",  None,  None],]


x = 1
y = 1
keycode = ""
for line in input:
	for move in line:
		if move == "R":
			if x != 2:
				x += 1
		elif move == "L":
			if x != 0:
				x -= 1
		elif move == "D":
			if y != 2:
				y += 1
		elif move == "U":
			if y != 0:
				y -= 1
		else:
			print("ERROR")
	keycode += str(keypad[y][x])

print(keycode)

x = 0
y = 2
keycode2 = ""
for line in input:
	for move in line:
		if move == "R":
			if x != 4 and keypad2[y][x + 1] != None:
				x += 1
		elif move == "L":
			if x != 0 and keypad2[y][x - 1] != None:
				x -= 1
		elif move == "D":
			if y != 4 and keypad2[y + 1][x] != None:
				y += 1
		elif move == "U":
			if y != 0 and keypad2[y - 1][x] != None:
				y -= 1
		else:
			print("ERROR")
	keycode2 += str(keypad2[y][x])
print(keycode2)
